import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Container } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import Logo from "../Assets/Logo.svg";

const MyNavbar = () => {
  return (
    <Navbar className='container' expand="xl">
      <Container >
        <Navbar.Brand className='d-flex items-center' as={NavLink} to="/">
          <img src={Logo} width={70} alt="Logo" className="logo" />
          <div

            style={{
              background: "linear-gradient(90deg, rgba(255,99,0,1) 0%, rgba(75,242,255,1) 100%)",
              WebkitBackgroundClip: "text",
              WebkitTextFillColor: "transparent"
            }}
          >
            <div className='text-sm font-semibold'>Being Sanjeevani Foundation</div>
            <div className='text-sm'>"Where Care Meets Compassion"</div>

          </div>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            <Nav.Link as={NavLink} to="/" exact>
              Home
            </Nav.Link>
            <Nav.Link as={NavLink} to="/about-us">
              About Us
            </Nav.Link>
            <Nav.Link as={NavLink} to="/contact-us">
              Contact Us
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default MyNavbar;
